import React from 'react'

const Skills = () => {
  return (
    <div id='skills' className='bg-gradient-to-b from-[#0e1217] via-[#040008] to-[#0e1217] h-[80vh] text-center flex items-center justify-center gap-10 p-12'>
      <div class="backdrop-blur-xl border-2 border-[#eae9e0] rounded-lg bg-transparent shadow-md shadow-[#dee3de] h-96 w-96 mt-16"> Skills </div>
      <div class="backdrop-blur-xl border-2 border-[#eae9e0] rounded-lg bg-transparent shadow-md shadow-[#dee3de] h-96 w-96"> Skills </div>
      <div class="backdrop-blur-xl border-2 border-[#eae9e0] rounded-lg bg-transparent shadow-md shadow-[#dee3de] h-96 w-96 mt-16"> Skills </div>
    </div>
  )
}

export default Skills
